import React from 'react'

const App = () => {
  let crtime = new Date();
  crtime = crtime.getHours()
  let getting = "";
  let cssStyle ={}

  if(crtime >=1 && crtime < 12){
    getting = "Good Morning";  
    cssStyle.coler='yallow'
  }else if(crtime >=1 && crtime < 12){
    cssStyle.coler='yallow'
  }else{
    getting = "Good Night";  
  }
  return (
    <>
      <h1>Hello MR. {getting}</h1>
    </>
  )
}

export default App
